css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("boards.4chan.org") {
  


  body{
    font-family: pixelated !important;
    font-size: 25px !important;
    
    background: black !important;
    color: white !important;
    font-smooth: never;
    -webkit-font-smoothing : none;
  }
  
  .quote{
    color: #f22e53 !important;
  }
  
  .post, .reply, .replyContainer, .pagelist{
    background: transparent !important;
    border: none !important;
  }
  
  .postInfo, .postInfoM, .quotelink, .sideArrows,  .fileText, .hide-reply-button{
    display: none !important;
  }
  
  .quotelink + br {display: none}

  blockquote::before{
    content: "| ";
  }

  blockquote{
    padding: 0;
    margin: 12px;
  }
  
  body{
    max-width: 600px;
    margin: 0 auto;
  }
  
  .postForm td, .postForm textarea, .postForm input{
    background: transparent !important;
    color: white !important;
    border: none !important;
    
  }
  
  img, .fileThumb{
    float: none !important;
  }
  
  .board img{
    filter: sepia(40%) saturate(60%);

    image-rendering: -moz-crisp-edges;         /* Firefox */
    image-rendering:   -o-crisp-edges;         /* Opera */
    image-rendering: -webkit-optimize-contrast;/* Webkit (non-standard naming) */
    image-rendering: crisp-edges;
    -ms-interpolation-mode: nearest-neighbor;  /* IE (non-standard property) */

    
    width: 250px !important;
    height: auto !important;
    max-height: 500px !important;
    
    
    background: black;
    padding: 3px;
    border: 3px solid white !important;
  }
  
  
  
  
  
  
  
  
  
  
  
  
  
  
  
  
  
  
